import React, { Component } from 'react';
import { connect } from 'react-redux'

class List extends Component {
    constructor(){
        super();
       this.handleDelete = this.handleDelete.bind(this);
       this.handleEdit = this.handleEdit.bind(this);
    }
  render() {
      console.log(this.props.listData.users)
    return (
     <div >
       <p>Items : {this.props.listData.users.length}</p>
        {this.props.listData.users && this.props.listData.users.map((data)=>
                <p>{data.id} {data.price} {data.product} {data.quantity} 
                <a href="Javascript:void(0);" onClick={this.handleDelete}>DELETE</a> ||
                <a href="Javascript:void(0);" onClick={this.handleEdit}>EDIT</a>
                </p>
            )}
      </div>

    );
  }
}


const mapStateToProps = state => ({
    listData: state
  })

//export default List;


export default connect(
    mapStateToProps,
 //   mapDispatchToProps
  )(List)
